d him for the big day, wedding and reception. He did not disappoint. He has the right amount of magic sprinkled in for a wedding, and the exact amount of organization and presence of mind to get you through the cocktail hour, dinner and the necessities. But..... the amount of hype and noise he comes with for the reception is game day epic! My kids were blown away by the cheers, the love, the noise (and let me say, not in a bad way or distasteful)...it was amazing! They felt the love, the applause and the cheers from their friends and family because DJ Obie can bring it. He IS the hypemaster, he DOES bring your reception to another level. Hiring him for this day was a great investment and well worth it, there is no price tag on the magic he brought to the day! It was a blast and we will never forget it!!\\n\\nThank you for everything and the little extras of making announcements for transportation home, photos, food line, and getting folks involved. Even the big reentrance of the bride after her shocking haircut!\\n\\nThank you once again and I hope we see each other again one day!! Keep bringing the magic!!\",5,null,\"112983507708675891697\",[\"https://www.google.com/local/review/rap/report?postId\\u003dChdDSUhNMG9nS0VJQ0FnSUNGcTV6a2l3RRAB\\u0026entityid\\u003dChdDSUhNMG9nS0VJQ0FnSUNGcTV6a2l3RRItChZDSUhNMG9nS0VJQ0FnSUNGcTV6a1N3EhNDZ3dJMy1tT3FnWVFxUF9LMVFNGi4KF0NJSE0wb2dLRUlDQWdJQ0ZxNXpreXdFEhNDZ3dJMy1tT3FnWVFxUF9LMVFNIhIJ_UZBuBTe6UkRP9-vggB7ja8qE0Nnd0kzLW1PcWdZUXFQX0sxUU0\\u0026wv\\u003d1\\u0026d\\u003d286732320\",\"Flag as inappropriate\",null,\"0ahUKEwjDvoOrzrKCAxU5l2oFHeb4Dn4QoykITSgD\"],null,[\"6 hours ago\",\"OMG, your review brings me so much joy. Definitely makes my heart feel warm. Thanks for being so thoughtful with the kind words you shared. Im glad I could be a part of you and your families epic day. Fingers crossed I see you again soon. You are the best \",null,1699362736993,1699362736993,null,null,\"en\"],\"ChdDSUhNMG9nS0VJQ0FnSUNGcTV6a2l3RRAB\",\"0ahUK ave him as our DJ. I had mutual friends from college that knew him and had attended teacher trainings with his significant other. We were told we *might have him as our DJ but our purchase level wouldnt guarantee it. We were so fortunate to realize we did in fact have him as our DJ. Even throughout the cocktail hour he was lively and entertaining guests. As the reception began, the power/sound went out multiple times, and he powered through. I truly have never seen a wedding DJ more positively encourage and engage guests. The dance floor was never empty, and DJ Obie joined us on the floor as the night went on. To this day I think his involvement in our wedding made it that much better.\",5,null,\"110997903613272930081\",[\"https://www.google.com/local/review/rap/report?postId\\u003dChdDSUhNMG9nS0VJQ0FnSUNwbzlmYjVBRRAB\\u0026entityid\\u003dChdDSUhNMG9nS0VJQ0FnSUNwbzlmYjVBRRItChZDSUhNMG9nS0VJQ0FnSUNwbzlmYkZBEhNDZ3dJZzhuT3BnWVEyUHZlMEFJGi4KF0NJSE0wb2dLRUlDQWdJQ3BvOWZibEFFEhNDZ3dJZzhuT3BnWVEyUHZlMEFJIhIJ_UZBuBTe6UkRP9-vggB7ja8qE0Nnd0lnOG5PcGdZUTJQdmUwQUk\\u0026wv\\u003d1\\u0026d\\u003d286732320\",\"Flag as inappropriate\",null,\"0ahUKEwjDvoOrzrKCAxU5l2oFHeb4Dn4QoykIVygD\"],null,[\"2 months ago\",\"Working through the power situation was iconic at your wedding Nick. Although its not what you want to happen (like ever ) it couldnt have been more perfect. And figuring out a cleaver way to make it a bonus was super exciting. Im glad I was a part of your special day brother. And thanks for the review. \",null,1693800621069,1693800621069,null,null,\"en\"],\"ChdDSUhNMG9nS0VJQ0FnSUNwbzlmYjVBRRAB\",\"0ahUKEwjDvoOrzrKCAxU5l2oFHeb4Dn4Q4R4IUygH\",[null,[null,3,0,\"https://lh3.googleusercontent.com/a/ACg8ocJY8DDBq4HxYo17b6r757R_oFwsE03spIjUzQ6469mf\\u003ds120-c-rp-mo-br100\",\"Nicholas Newman\",\"https://www.google.com/maps/contrib/110997903613272930081?hl\\u003den-US\",null,0,\"https://www.google.com/maps/contrib/110997903613272930081?hl\\u003den-US\",null,null,null,[\"3 reviews\", ped into him again at a bridal show with my sons bride. We talked and vibed and the rest wrote itself.\\n\\nWe hired him for the big day, wedding and reception. He did not disappoint. He has the right amount of magic sprinkled in for a wedding, and the exact amount of organization and presence of mind to get you through the cocktail hour, dinner and the necessities. But..... the amount of hype and noise he comes with for the reception is game day epic! My kids were blown away by the cheers, the love, the noise (and let me say, not in a bad way or distasteful)...it was amazing! They felt the love, the applause and the cheers from their friends and family because DJ Obie can bring it. He IS the hypemaster, he DOES bring your reception to another level. Hiring him for this day was a great investment and well worth it, there is no price tag on the magic he brought to the day! It was a blast and we will never forget it!!\\n\\nThank you for everything and the little extras of making announcements for transportation home, photos, food line, and getting folks involved. Even the big reentrance of the bride after her shocking haircut!\\n\\nThank you once again and I hope we see each other again one day!! Keep bringing the magic!!\",\"en\",null,null,null,null,0,null,[0,146]],null,null,null,null,null,null,null,null,null,null,null,null,[\"en\"],[[\"I saw DJ Obie for the first time as an emcee for a wedding ceremony.  I was honestly blown away by his presence and how he ran the wedding itself.\\n\\nI bumped into him again at a bridal show with my sons bride. We talked and vibed and the rest wrote itself.\\n\\nWe hired him for the big day, wedding and reception. He did not disappoint. He has the right amount of magic sprinkled in for a wedding, and the exact amount of organization and presence of mind to get you through the cocktail hour, dinner and the necessities. But..... the amount of hype and noise he comes with for the reception is game day epic! My kids were blown away by the cheers, the love, the noise (and let me say, not in a bad way or distasteful)...it was amazing! They felt the love, the applause and the cheers from their friends and family because DJ Obie can bring it. He IS the hypemaster, he DOES bring your reception to another level. Hiring him for this day was a great investment and well worth it, there is no price tag on the magic he brought to the day! It was a blast and we will never forget it!!\\n\\nThank you for everything and the little extras of making announcements for transportation home, photos, food line, and getting folks involved. Even the big reentrance of the bride after her shocking haircut!\\n\\nThank you once again and I hope we see each other again one day!! Keep bringing the magic!!\",null,[0,146]]]],[[\"OMG, your review brings me so much joy. Definitely makes my heart feel warm. Thanks for being so thoughtful with the kind words you shared. Im glad I could be a part of you and your families epic day. Fingers crossed I see you again soon. You are the best \",\"en\"],1699362736993771,1699362736993771,\"6 hours ago\",null,\"https://business.google.com/local/business/11087166322524555538/customers/reviews/reply?p\\u003dCiRDaGREU1VoTk1HOW5TMFZKUTBGblNVTkdjVFY2YTJsM1JSQUIQAA%3D%3D\",[null,null,null,\"/local/business/11087166322524555538/customers/reviews/reply?p\\u003dCiRDaGREU1VoTk1HOW5TMFZKUTBGblNVTkdjVFY2YTJsM1JSQUIQAA%3D%3D\"],\"https://business.google.com/local/business/11087166322524555538/customers/reviews/deletereply?p\\u003dCiRDaGREU1VoTk1HOW5TMFZKUTBGblNVTkdjVFY2YTJsM1JSQUIQAA%3D%3D\",[null,null,null,\"/local/business/11087166322524555538/customers/reviews/deletereply?p\\u003dCiRDaGREU1VoTk1HOW5TMFZKUTBGblNVTkdjVFY2YTJsM1JSQUIQAA%3D%3D\"],null,\"https://business.google.com/local/business/11087166322524555538/customers/reviews/reply?p\\u003dCiRDaGREU1VoTk1HOW5TMFZKUTBGblNVTkdjVFY2YTJsM1JSQUIQAA%3D%3D\",[null,null,null,\"/local/business/11087166322524555538/customers/reviews/reply?p\\u003dCiRDaGREU1Vo imes, and he powered through. I truly have never seen a wedding DJ more positively encourage and engage guests. The dance floor was never empty, and DJ Obie joined us on the floor as the night went on. To this day I think his involvement in our wedding made it that much better.\",\"en\",null,null,null,null,0,null,[0,238]],null,null,null,null,null,null,null,null,null,null,null,null,[\"en\"],[[\"What else can we say about DJ Obie? In our wedding planning we requested to have him as our DJ. I had mutual friends from college that knew him and had attended teacher trainings with his significant other. We were told we *might have him as our DJ but our purchase level wouldnt guarantee it. We were so fortunate to realize we did in fact have him as our DJ. Even throughout the cocktail hour he was lively and entertaining guests. As the reception began, the power/sound went out multiple times, and he powered through. I truly have never seen a wedding DJ more positively encourage and engage guests. The dance floor was never empty, and DJ Obie joined us on the floor as the night went on. To this day I think his involvement in our wedding made it that much better.\",null,[0,238]]]],[[\"Working through the power situation was iconic at your wedding Nick. Although its not what you want to happen (like ever ) it couldnt have been more perfect. And figuring out a cleaver way to make it a bonus was super exciting. Im glad I was a part of your special day brother. And thanks for the review. \",\"en\"],1693800621069628,1693800621069628,\"2 months ago\",null,\"https://business.google.com/local/business/11087166322524555538/customers/reviews/reply?p\\u003dCiRDaGREU1VoTk1HOW5TMFZKUTBGblNVTndiemxtWWpWQlJSQUIQAA%3D%3D\",[null,null,null,\"/local/business/11087166322524555538/customers/reviews/reply?p\\u003dCiRDaGREU1VoTk1HOW5TMFZKUTBGblNVTndiemxtWWpWQlJSQUIQAA%3D%3D\"],\"https://business.google.com/local/business/11087166322524555538/customers/reviews/deletereply?p\\u003dCiRDaGREU1VoTk1HOW5TM
